import { BaseDomain } from 'core/domain/common'

export class RegisterUserResult extends BaseDomain {

  private _uid: string
  constructor (uid: string) {
    super()

    this._uid = uid
  }
    /**
     * User identifier
     *
     * @type {string}
     * @memberof LoginUser
     */

  public get uid (): string {
    return this._uid
  }
}
